(15, 'Exchange Product Email Format', '', '<table border="1" style="width:666px;" width="666">\r\n	<tbody>\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Name :</strong></p>\r\n			</td>\r\n			\r\n			<td style="width:546px;">\r\n				<p>\r\n					{NAME}</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Email :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>\r\n					<a href="mailto:{EMAIL}" target="_blank">{EMAIL}</a></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Phone :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{PHONE}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Company Desired Name 1 :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{COMPANY_NAME1}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Company Desired Name 2 :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{COMPANY_NAME2}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Company Desired Name 3 :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{COMPANY_NAME3}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Company Desired Name 4 :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{COMPANY_NAME4}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Country Name :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{COUNTRY}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>State/City Name :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{STATE_CITY}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Virtual Office :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{VIRTUAL_OFFICE}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Toll Free Number :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{TOLL_FREE}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Company Website :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{COMPANY_WEBSITE}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Urgent Service :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{URGENT_SERVICE}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Virtual Assistant  :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{VIRTUAL_ASSISTANT}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n		<tr>\r\n			<td style="width:117px;">\r\n				<p align="right">\r\n					<strong>Hard Copy   :</strong></p>\r\n			</td>\r\n			<td style="width:546px;">\r\n				<p>{HARD_COPY}</p>\r\n					\r\n			</td>\r\n		</tr>\r\n		\r\n	</tbody>\r\n				</table>', '', 'Online Feedback', '', 0, 1, ''),
(21, '', '', '<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">\r\n<html xmlns="http://www.w3.org/1999/xhtml">\r\n<head>\r\n<meta http-equiv="Content-Type" content="text/html; charset=utf-8" />\r\n<title>Untitled Document</title>\r\n</head>\r\n\r\n<body>\r\n<p>\r\n	<br />\r\n	<strong><br />\r\n	<strong></strong></p>\r\n</body>\r\n</html>', '', 'Incorp24.com', '', 0, 0, ''),
(20, 'Auto Reply', '', '<table align="center" cellpadding="5" cellspacing="5" style="background-color:#CCCCCC;font-family:Calibri;  font-size:18px;" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<table align="center" cellpadding="5" cellspacing="5" width="100%">\r\n					<tbody>\r\n						<tr>\r\n							<td>\r\n								<div style="background-color:#FFFFFF;-webkit-border-radius:7px;-moz-border-radius:7px;border-radius:7px;-moz-box-shadow: 0 0 3px 3px #999999;\r\n-webkit-box-shadow: 0 0 3px 3px #999999;\r\nbox-shadow: 0 0 3px 3px #999999; padding:30px; border:#CCCCCC 1px solid;">\r\n									<table cellpadding="5" cellspacing="5" width="100%">\r\n										<tbody>\r\n											<tr>\r\n												<td style="border-bottom:#CCCCCC 2px solid; padding-bottom:12px;">\r\n													<div class="logo">\r\n														<a href="http://service4.5gbfree.com"><img src="http://service4.5gbfree.com/incorp/images/logo.png" /></a></div>\r\n												</td>\r\n											</tr>\r\n											<tr>\r\n												<td style="padding-top:20px;">\r\n													<div>\r\n														<span style="font-size: 16px;"><strong>Hello {MEMBER TO},</strong></span></div>\r\n													<div>\r\n														<br />\r\n														<span style="font-size: 16px;">Thank you for your Order we will contact you within 24 hours\r\n</span><br />\r\n														&nbsp;</div>\r\n													<div>\r\n														<span style="font-size: 16px;">Regards ,</span><br />\r\n														<span style="font-size: 16px;">{COMPANY NAME}.</span></div>\r\n												</td>\r\n											</tr>\r\n										</tbody>\r\n									</table>\r\n								</div>\r\n							</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="padding:0px 20px; border:#CCCCCC 1px solid; color:#666666; font-size:14px; font-weight:bold;">\r\n				<p>\r\n					{CONTACT INFO}</p>\r\n				</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n', '', 'Incorp24', '', 0, 0, '');
